// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract ElectionContract {
    address public owner;
    address[] public admins;
    string[] public electionIds;

    struct Candidate {
        string id;
        string name;
        uint256 voteCount;
    }

    struct Position {
        string id;
        string name;
        Candidate[] candidates;
    }

    struct Election {
        string id;
        string name;
        bool isLive;
        bool isArchived;
        uint256 createdAt;
        Position[] positions;
    }

    mapping(string => Election) public elections;
    mapping(address => mapping(string => bool)) public hasVoted;
    mapping(address => bool) public isAdmin;

    event ElectionCreated(string electionId, string name, address creator);
    event Voted(address voter, string electionId, string[] positionIds);
    event ElectionStatusUpdated(string electionId, bool isLive);
    event ElectionArchived(string electionId);
    event AdminAdded(address admin);
    event AdminRemoved(address admin);
    event OwnershipTransferred(address previousOwner, address newOwner);

    constructor() {
        owner = msg.sender;
        isAdmin[msg.sender] = true;
        admins.push(msg.sender);
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier onlyAdmin() {
        require(isAdmin[msg.sender], "Only admin can call this function");
        _;
    }

    modifier electionExists(string memory electionId) {
        require(bytes(elections[electionId].id).length > 0, "Election does not exist");
        _;
    }

    modifier electionActive(string memory electionId) {
        require(elections[electionId].isLive, "Election is not live");
        _;
    }

    modifier notArchived(string memory electionId) {
        require(!elections[electionId].isArchived, "Election is archived");
        _;
    }

    function addAdmin(address admin) external onlyOwner {
        require(admin != address(0), "Invalid address");
        require(!isAdmin[admin], "Already an admin");

        isAdmin[admin] = true;
        admins.push(admin);

        emit AdminAdded(admin);
    }

    function removeAdmin(address admin) external onlyOwner {
        require(admin != owner, "Cannot remove owner from admin");
        require(isAdmin[admin], "Not an admin");

        isAdmin[admin] = false;

        // Remove from admins array
        for (uint i = 0; i < admins.length; i++) {
            if (admins[i] == admin) {
                // Replace with the last element and pop
                admins[i] = admins[admins.length - 1];
                admins.pop();
                break;
            }
        }

        emit AdminRemoved(admin);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid address");

        // Make sure new owner is an admin
        if (!isAdmin[newOwner]) {
            isAdmin[newOwner] = true;
            admins.push(newOwner);
            emit AdminAdded(newOwner);
        }

        address previousOwner = owner;
        owner = newOwner;

        emit OwnershipTransferred(previousOwner, newOwner);
    }

    function createElection(
        string memory electionId,
        string memory name,
        string[] memory positionIds,
        string[] memory positionNames,
        string[][] memory candidateIds,
        string[][] memory candidateNames
    ) external onlyAdmin {
        require(bytes(elections[electionId].id).length == 0, "Election already exists");
        require(positionIds.length == positionNames.length, "Position data mismatch");
        require(positionIds.length == candidateIds.length, "Position and candidate data mismatch");
        require(positionIds.length == candidateNames.length, "Position and candidate name data mismatch");

        Election storage newElection = elections[electionId];
        newElection.id = electionId;
        newElection.name = name;
        newElection.isLive = true; // Elections are now live by default
        newElection.isArchived = false;
        newElection.createdAt = block.timestamp;

        for (uint256 i = 0; i < positionIds.length; i++) {
            Position storage newPosition = newElection.positions.push();
            newPosition.id = positionIds[i];
            newPosition.name = positionNames[i];

            require(candidateIds[i].length == candidateNames[i].length, "Candidate data mismatch");

            for (uint256 j = 0; j < candidateIds[i].length; j++) {
                newPosition.candidates.push(Candidate({
                    id: candidateIds[i][j],
                    name: candidateNames[i][j],
                    voteCount: 0
                }));
            }
        }

        electionIds.push(electionId);
        emit ElectionCreated(electionId, name, msg.sender);
    }

    function voteMultiple(
        string memory electionId,
        string[] memory positionIds,
        string[] memory candidateIds
    ) external electionExists(electionId) electionActive(electionId) notArchived(electionId) {
        require(!hasVoted[msg.sender][electionId], "Already voted");
        require(positionIds.length == candidateIds.length, "Mismatched array lengths");

        Election storage election = elections[electionId];

        for (uint i = 0; i < positionIds.length; i++) {
            bool positionFound = false;
            for (uint j = 0; j < election.positions.length; j++) {
                if (keccak256(abi.encodePacked(election.positions[j].id)) == keccak256(abi.encodePacked(positionIds[i]))) {
                    positionFound = true;
                    bool candidateFound = false;
                    for (uint k = 0; k < election.positions[j].candidates.length; k++) {
                        if (keccak256(abi.encodePacked(election.positions[j].candidates[k].id)) == keccak256(abi.encodePacked(candidateIds[i]))) {
                            election.positions[j].candidates[k].voteCount++;
                            candidateFound = true;
                            break;
                        }
                    }
                    require(candidateFound, "Candidate not found for position");
                    break;
                }
            }
            require(positionFound, "Position not found in election");
        }

        hasVoted[msg.sender][electionId] = true;
        emit Voted(msg.sender, electionId, positionIds);
    }

    function getElection(string memory electionId) external view electionExists(electionId) returns (
        string memory id,
        string memory name,
        bool isLive,
        bool isArchived,
        uint256 createdAt,
        Position[] memory positions
    ) {
        Election storage election = elections[electionId];
        return (
            election.id,
            election.name,
            election.isLive,
            election.isArchived,
            election.createdAt,
            election.positions
        );
    }

    function toggleElectionStatus(string memory electionId, bool status)
        external
        onlyAdmin
        electionExists(electionId)
        notArchived(electionId)
    {
        elections[electionId].isLive = status;
        emit ElectionStatusUpdated(electionId, status);
    }

    function archiveElection(string memory electionId)
        external
        onlyAdmin
        electionExists(electionId)
    {
        // First ensure the election is not live
        require(!elections[electionId].isLive, "Cannot archive a live election");

        elections[electionId].isArchived = true;
        emit ElectionArchived(electionId);
    }

    function getAllElectionIds() external view returns (string[] memory) {
        return electionIds;
    }

    function getActiveElectionIds() external view returns (string[] memory) {
        uint256 activeCount = 0;

        // First count active elections
        for (uint256 i = 0; i < electionIds.length; i++) {
            if (!elections[electionIds[i]].isArchived) {
                activeCount++;
            }
        }

        // Then create and populate the result array
        string[] memory activeIds = new string[](activeCount);
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < electionIds.length; i++) {
            if (!elections[electionIds[i]].isArchived) {
                activeIds[currentIndex] = electionIds[i];
                currentIndex++;
            }
        }

        return activeIds;
    }

    function getAdmins() external view returns (address[] memory) {
        return admins;
    }

    function hasUserVoted(string memory electionId, address user) external view returns (bool) {
        return hasVoted[user][electionId];
    }
}
